
public class Discos {
	
	private String fechaPublicacion, cancion, titulo, nombreCantante_Grupo;

	public Discos() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getFechaPublicacion() {
		return fechaPublicacion;
	}

	public void setFechaPublicacion(String fechaPublicacion) {
		this.fechaPublicacion = fechaPublicacion;
	}

	public String getCancion() {
		return cancion;
	}

	public void setCancion(String cancion) {
		this.cancion = cancion;
	}

	public String getTitulo() {
		return titulo;
	}

	public void setTitulo(String titulo) {
		this.titulo = titulo;
	}

	public String getNombreCantante_Grupo() {
		return nombreCantante_Grupo;
	}

	public void setNombreCantante_Grupo(String nombreCantante_Grupo) {
		this.nombreCantante_Grupo = nombreCantante_Grupo;
	}
	
}
